import React, { Component } from 'react';
import Square from './Square.js';
import AgeLabel from './AgeLabel';
import AgeKids from './AgeKids.js';
import MealPreferences from './MealPreferences.js';
import Interests from './Interests';
import IncrementComponent from './IncrementComponent.js';

class Card extends Component {
    render() {
        var styles = {
            cardStyle: {
                height: 400,
                width: 300,
                float: "left",
                backgroudColor: "#FFF",
                boxShadow: "0px 0px 5px #666",
                margin: "20px",
            },



        }

        return (
            <div>
                <h1> Profile </h1>

                <div style={styles.cardContainer}>
                    <div style={styles.cardStyle}>
                        <Square />

                        <div style={styles.titleStyle}>

                            <ul>
                                <div style={styles.titleAge}>
                                    <li>Adults  (18-64)</li>
                                    <div style={styles.titleRange}>
                                        <IncrementComponent />
                                    </div>
                                </div>

                                <li>  Seniors (65+)<IncrementComponent /></li>
                                <li> Youth (12-17)<IncrementComponent /></li>
                                <li>  Child (2-11)<IncrementComponent /></li>
                                <li>Seat Infant (under 2) <IncrementComponent /></li>
                                <li>Lap Infant (under 2)<IncrementComponent /></li>
                            </ul>

                        </div>


                    </div>



                    <div style={styles.cardStyle}>
                        <Square />
                        <MealPreferences />


                    </div>

                    <div style={styles.cardStyle}>
                        <Square />
                        <p> </p>
                        <Interests />



                    </div>
                </div>

            </div>
        );
    }
}

export default Card;
